import React from 'react'
import ReactDOM from 'react-dom'
function TodoItem(){
	return(
		<div  class="todo-item">
      
      <input type="checkbox"/>
      <p>check box 1</p>
      <input type="checkbox"/>
      <p>check box 2</p>
      <input type="checkbox"/>
      <p>check box 3</p>
      </div>

		)
}
export default TodoItem;
